#!/usr/bin/env python3

from pathlib import Path
from PIL import Image
import sys, os, re, base64, hashlib, subprocess

original_images_folder = Path("original")
working_folder = Path("working_cache")
dds_images_folder = Path("dds_textures")

class OriginalImage:
	def __init__(self, file_path, cache_folder):
		self.file_path = file_path
		self.image = Image.open(self.file_path)

		self.width, self.height = self.image.size
		if not ((self.width == 2048 and self.height == 2048) or
				(self.width == 1024 and self.height == 2048) or
				(self.width == 2048 and self.height == 1024)
			):
			self.valid_size = False
		else:
			self.valid_size = True

		self.cache_folder = cache_folder

	def createTextureImage(self):
		output_file_path = self.cache_folder / f"{self.file_path.stem}_texture.png"

		if output_file_path.exists():
			return False

		output_image = Image.new("RGBA", (self.width, self.height), (0, 0, 0, 255))
		output_image.paste(self.image, mask=self.image)

		output_image.save(output_file_path)
		return True

	def createMaskImage(self):
		output_file_path = self.cache_folder / f"{self.file_path.stem}_mask.png"

		if output_file_path.exists():
			return False

		output_image = Image.new("RGBA", (self.width, self.height), (0, 0, 255, 255))

		foreground_image = self.image.copy()

		#set colour to cyan
		new_pixel_data = []
		for pixel in foreground_image.getdata():
			new_pixel_data.append((0, 255, 255, pixel[3]))
		foreground_image.putdata(new_pixel_data)

		output_image.paste(foreground_image, mask=foreground_image)

		output_image.save(output_file_path)
		return True

	def createThumbnailImage(self):
		output_file_path = self.cache_folder / f"{self.file_path.stem}_thumbnail.png"

		if output_file_path.exists():
			return False

		new_image_size = (self.width // 16, self.height // 16)
		output_image = self.image.copy().resize(new_image_size, Image.Resampling.LANCZOS)

		output_image.save(output_file_path)
		return True

class Texconv:
	def __init__(self, output_binary_path):
		self.path = output_binary_path

		if self.path.exists():
			return

		with open(sys.argv[0], "r") as f:
			while line := f.readline():
				if line.strip() == "__TEXCONV_BINARY__":
					md5sum_match = re.match(r"^MD5SUM=([A-Za-z\d]{32})$", f.readline().strip())
					if not md5sum_match:
						print("The line below \"__TEXCONV_BINARY__\" was invalid; it must be \"MD5SUM=*\"", file=sys.stderr)
						sys.exit(1)

					expected_md5sum = md5sum_match.groups(1)[0]

					binary_b64 = f.readline().strip()
					with(open(self.path, "wb")) as o:
						o.write(base64.b64decode(binary_b64))

					with open(self.path, "rb") as written_file:
						found_md5sum = hashlib.md5(written_file.read()).hexdigest()
						if not expected_md5sum == found_md5sum:
							print(f"MD5SUM of \"{self.path}\" is not as expected ({found_md5sum}), deleting - consider downloading the binary manually from github and placing it in the correct folder", file=sys.stderr)
							self.path.unlink()
							sys.exit(1)
					return

		print(f"Did not find \"__TEXCONV_BINARY__\" in this script file, it is needed to copy across \"{self.path}\", which can be done by manually downloading it instead")
		sys.exit(1)

	def convertAll(self, input_folder, output_folder):
		command = [
			self.path,
			"-nologo",
			"-m", "1", #disable mipmaps
			"-dx10",
			"-srgbi",
			"-f", "BC1_UNORM_SRGB",
			"-ft", "dds",
			"-o", output_folder,
			"-y", #overwrite if already exists

			f"{input_folder}\\*.png"
		]

		environment = os.environ.copy()

		if not sys.platform == "win32":
			command = ["wine"] + command
			environment["WINEDEBUG"] = "-all" #disable noise from WINE

		subprocess.run(command, env=environment)



def createFolders(*folder_paths):
	for folder in folder_paths:
		if not folder.is_dir():
			folder.mkdir()

if __name__ == "__main__":
	createFolders(original_images_folder, working_folder, dds_images_folder)

	for file in original_images_folder.glob("*.png"):
		print(f"Processing \"{file}\"")
		original_image = OriginalImage(file, working_folder)

		if not original_image.valid_size:
			print(f"    Invalid image dimensions ({original_image.width}, {original_image.height}), skipping")
			continue

		if not original_image.createTextureImage():
			print("    Texture image already exists, skipping generation")

		if not original_image.createMaskImage():
			print("    Mask image already exists, skipping generation")

		if not original_image.createThumbnailImage():
			print("    Thumbnail image already exists, skipping generation")

	texconv = Texconv(working_folder / "texconv.exe")
	print(f"Using \"{texconv.path}\" for texture conversion")

	texconv.convertAll(working_folder, dds_images_folder)
	print(f"Written DDS files to \"{dds_images_folder}\"")


